<!DOCTYPE html>
<html>
<head>
    <title>My Joke Website</title>
    <style>
        body {
            background-color: #f0f0f0;
            font-family: Arial, sans-serif;
            text-align: center;
            margin: 0;
            padding: 0;
        }
        #joke-container {
            max-width: 600px;
            margin: 0 auto;
            padding: 20px;
            background-color: #fff;
            border-radius: 5px;
            box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
        }
        #joke-title {
            font-size: 24px;
            margin-bottom: 10px;
        }
        #joke-text {
            font-size: 18px;
            line-height: 1.5;
            margin-bottom: 20px;
        }
        #joke-button {
            padding: 10px 20px;
            background-color: #007bff;
            color: #fff;
            border: none;
            border-radius: 5px;
            cursor: pointer;
        }
    </style>
</head>
<body>
    <div id="joke-container">
        <h1 id="joke-title">My Joke Website</h1>
        <p id="joke-text">Why did the chicken cross the road?</p>
        <button id="joke-button">Click to reveal the joke</button>
    </div>

    <script>
        const jokeTitle = document.getElementById('joke-title');
        const jokeText = document.getElementById('joke-text');
        const jokeButton = document.getElementById('joke-button');

        jokeButton.addEventListener('click', () => {
            jokeTitle.textContent = 'The chicken wanted to get to the other side!';
            jokeText.textContent = 'It was a long road, but it made it safely to the other side.';
        });
    </script>
</body>
</html>
```

In this HTML/JS code:
- The HTML structure sets up a simple webpage with a title, text, and button.
- The CSS styles the page with a light gray background, centered text, and a blue button.
- The JavaScript code adds an event listener to the button. When clicked, it changes the text content of the title and text elements to reveal the joke.

